Patch Set 1: Verified+1

The previous commit had invalid delta with improperly recorded bzip2 programme name (/usr/lib/zgz/upstream-bzip2/bzip2) making it impossible to checkout the tarball with the pristine-tar command. This one has this problem fixed. To check the difference run the following script after fetching this change.

 for tree in 120bb19d fe0253ca; do
        git ls-tree $tree -- alsa-utils-1.0.26.tar.bz2.delta;
 done | while read perm type hash file; do
        echo alsa-utils-1.0.26.tar.bz2.delta:
        git cat-file -p $hash | tar -zvtf -; echo -----
        echo wrapper:
        git cat-file -p $hash | tar --to-stdout -zxf - wrapper | tar -ztvf -; echo -----
        echo program:
        git cat-file -p $hash | tar --to-stdout -zxf - wrapper | tar --to-stdout -zxf - program; echo -----
 done
